package _044_Longest_Duplicate_Substring

import "testing"

func Test_longestDupSubstring(t *testing.T) {
	type args struct {
		s string
	}
	tests := []struct {
		name string
		args args
		want string
	}{
		{
			name: "nnpxouomcofdjuujloanjimymadkuepightrfodmauhrsy",
			args: args{"nnpxouomcofdjuujloanjimymadkuepightrfodmauhrsy"},
			want: "ma",
		},
		{
			name: "aa",
			args: args{"aa"},
			want: "a",
		},
		{
			name: "abcd",
			args: args{"abcd"},
			want: "",
		},
		{
			name: "sha...maoli...maoli...",
			args: args{""},
			want: "maoli",
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := longestDupSubstring(tt.args.s); got != tt.want {
				t.Errorf("longestDupSubstring() = %v, want %v", got, tt.want)
			}
		})
	}
}
